interface Persona {
    nombreCompleto: string;   
}

export const ObjetosLiterales = () => {

    const persona: Persona = {
        nombreCompleto: 'jesus',
        edad: 35,
        direccion: {
            pais: 'Canada',
            casaNo: 615

        }

    }
  return (
    <>
        <h3>ObjetosLiterales</h3>
        <code>
            <pre>
                {JSON.stringify(persona, null, 2)}
            </pre>
        </code>
    </>
  )
}
